@martinnguyenmma making a lot of sense here folks, the division needs title activity!
•~•~•~•~•~•~•~•~•~•~•~•~•~•~•~•~•~•~•~•~•~•~•~•~•
…And in my defense, if I’m in line for a title rematch, there’s no reason to take fights to stay busy… I wait to get my belt back. I know Martin got a nice new contract, if I were him, I’d be pushing to stay busy too. I’m not lucky enough to be in that position, so I wait for my Title shot, win… THEN get a nice new payday that incentivizes me to stay busy 🤷🏻‍♂️

